import React from "react";
import Slider from "react-slick";


export default (projectdata) => {
    console.log(projectdata,'pro')
    var settings = {
        dots: false,
        infinite: false,
        speed: 500,
        arrows: true,
        slidesToShow: 3,
        slidesToScroll: 1,
        initialSlide: 0,
        responsive: [
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2,
              infinite: true,
              dots: true
            }
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 1,
              initialSlide: 2
            }
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1
            }
          }
        ]
    };
    return (
        <div className="project-carousel py-20">
            <div className="container mx-auto">
                <div className="px-24">
                    <div className="slider-container">
                        {projectdata.map((item, index) => (
                            <Slider {...settings} key={index}>
                                <div className="px-4" >
                                    <div className="project-portfolio mb-5 p-7 text-left relative">
                                        <div class="inner-wrapper">
                                            <div class="thumbnail-image">
                                                <a href="javascript:void(0)" className="block rounded-lg overflow-hidden">
                                                    <img className="object-cover w-full" src="https://rainbowit.net/html/inbio/assets/images/portfolio/portfolio-03.jpg" alt="Personal Portfolio Images" />
                                                </a>
                                            </div>
                                            <div class="content-info pt-4">
                                                <div class="category-info pb-2.5 flex justify-between">
                                                    <div class="category-list flex flex-wrap items-center">
                                                        <a href="javascript:void(0)" className="uppercase block text-xs font-medium">{item.tag}</a>
                                                    </div>
                                                    <div class="meta">
                                                        <span className="font-medium text-xs"><a href="javascript:void(0)" tabindex="-1"><i class="feather-heart"></i></a>650</span>
                                                    </div>
                                                </div>
                                                <h4 class="title">
                                                    <a href="javascript:void(0)" className="font-semibold text-2xl">{item.title}<i class="feather-arrow-up-right"></i></a>
                                                </h4>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </Slider>
                        ))}
                    </div>
                </div>
            </div>
        </div>
      );
};
